<?PHP exit;?>	1485937116	小柯	1	118.193.141.211	plugins	GET={operation=config; do=80; identifier=milu_pick; pmod=picker_manage; myfunc=article_edit; aid=22; pid=1; public_flag=1; old_uid=418; url_args=&amp;s=&amp;status=1&amp;orderby=default&amp;ordersc=desc&amp;page=1; select=2; forums=51; set={title=绝对详细！Nginx基本配置、性能优化指南; summary=大多数的Nginx安装指南告诉你如下基础知识――通过apt-get安装，修改这里或那里的几行配置，好了，你已经有了一个Web服务器了！而且，在大多数情况下，一个常规安装的nginx对你的网站来说已经能很好地工作了。然而， ...; uid=418; view_num=61; is_download_img=1; is_water_img=1; public_time=2017-02-01 16:18; }; newalbum=请输入相册名称; view_albumid=none; message=&lt;p&gt;大多数的Nginx安装指南告诉你如下基础知识――通过apt-get安装，修改这里或那里的几行配置，好了，你已经有了一个Web服务器了！而且，在大多数情况下，一个常规安装的nginx对你的网站来说已经能很好地工作了。然而，如果你真的想挤压出nginx的性能，你必须更深入一些。在本指南中，我将解释Nginx的那些设置可以微调，以优化处理大量客户端时的性能。需要注意一点，这不是一个全面的微调指南。这是一个简单的预览――那些可以通过微调来提高性能设置的概述。你的情况可能不同。&lt;/p&gt; &lt;p style=&quot;text-align: center; text-indent: 0;&quot;&gt;&lt;img class=&quot;aligncenter&quot; src=&quot;http://upload.chinaz.com/2015/0424/1429857466710.jpg&quot; alt=&quot;Nginx配置 Nginx优化 Nginx安装&quot; border=&quot;0&quot; width=&quot;325&quot;&gt;&lt;/p&gt; &lt;p&gt;&lt;strong&gt;基本的 (优化过的)配置&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;我们将修改的唯一文件是&lt;strong&gt;nginx.conf&lt;/strong&gt;，其中包含Nginx不同模块的所有设置。你应该能够在服务器的&lt;strong&gt;/etc/nginx&lt;/strong&gt;目录中找到nginx.conf。首先，我们将谈论一些全局设置，然后按文件中的模块挨个来，谈一下哪些设置能够让你在大量客户端访问时拥有良好的性能，为什么它们会提高性能。本文的结尾有一个完整的配置文件。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;高层的配置&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;nginx.conf文件中，Nginx中有少数的几个高级配置在模块部分之上。&lt;/p&gt; &lt;blockquote&gt; &lt;ul&gt; &lt;li&gt;user www-data;&lt;/li&gt; &lt;li&gt;pid /var/run/nginx.pid;&lt;/li&gt; &lt;li&gt;worker_processes auto;&lt;/li&gt; &lt;li&gt;worker_rlimit_nofile 100000;&lt;/li&gt; &lt;/ul&gt; &lt;/blockquote&gt; &lt;p&gt;&lt;strong&gt;user&lt;/strong&gt;和&lt;strong&gt;pid&lt;/strong&gt;应该按默认设置 C 我们不会更改这些内容，因为更改与否没有什么不同。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;worker_processes &lt;/strong&gt;定义了nginx对外提供web服务时的worder进程数。最优值取决于许多因素，包括（但不限于）CPU核的数量、存储数据的硬盘数量及负载模式。不能确定的时候，将其设置为可用的CPU内核数将是一个好的开始（设置为“auto”将尝试自动检测它）。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;worker_rlimit_nofile &lt;/strong&gt;更改worker进程的最大打开文件数限制。如果没设置的话，这个值为操作系统的限制。设置后你的操作系统和Nginx可以处理比“ulimit -a”更多的文件，所以把这个值设高，这样nginx就不会有“too many open files”问题了。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;Events模块&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;events模块中包含nginx中所有处理连接的设置。&lt;/p&gt; &lt;blockquote&gt; &lt;ul&gt; &lt;li&gt;events {&lt;/li&gt; &lt;li&gt;worker_connections 2048;&lt;/li&gt; &lt;li&gt;multi_accept on;&lt;/li&gt; &lt;li&gt;use epoll;&lt;/li&gt; &lt;li&gt;}&lt;/li&gt; &lt;/ul&gt; &lt;/blockquote&gt; &lt;p&gt;&lt;strong&gt;worker_connections&lt;/strong&gt;设置可由一个worker进程同时打开的最大连接数。如果设置了上面提到的worker_rlimit_nofile，我们可以将这个值设得很高。&lt;/p&gt; &lt;p&gt;记住，最大客户数也由系统的可用socket连接数限制（~ 64K），所以设置不切实际的高没什么好处。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;multi_accept &lt;/strong&gt;告诉nginx收到一个新连接通知后接受尽可能多的连接。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;use&lt;/strong&gt; 设置用于复用客户端线程的轮询方法。如果你使用Linux 2.6+，你应该使用epoll。如果你使用*BSD，你应该使用kqueue。想知道更多有关事件轮询？看下维基百科吧（注意，想了解一切的话可能需要neckbeard和操作系统的课程基础）&lt;/p&gt; &lt;p&gt;（值得注意的是如果你不知道Nginx该使用哪种轮询方法的话，它会选择一个最适合你操作系统的）。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;HTTP 模块&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;HTTP模块控制着nginx http处理的所有核心特性。因为这里只有很少的配置，所以我们只节选配置的一小部分。所有这些设置都应该在http模块中，甚至你不会特别的注意到这段设置。&lt;/p&gt; &lt;blockquote&gt; &lt;ul&gt; &lt;li&gt;http {&lt;/li&gt; &lt;li&gt;server_tokens off;&lt;/li&gt; &lt;li&gt;sendfile on;&lt;/li&gt; &lt;li&gt;tcp_nopush on;&lt;/li&gt; &lt;li&gt;tcp_nodelay on;&lt;/li&gt; &lt;li&gt;}&lt;/li&gt; &lt;/ul&gt; &lt;/blockquote&gt; &lt;p&gt;&lt;strong&gt;server_tokens &lt;/strong&gt;并不会让nginx执行的速度更快，但它可以关闭在错误页面中的nginx版本数字，这样对于安全性是有好处的。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;sendfile&lt;/strong&gt;可以让sendfile()发挥作用。sendfile()可以在磁盘和TCP socket之间互相拷贝数据(或任意两个文件描述符)。Pre-sendfile是传送数据之前在用户空间申请数据缓冲区。之后用read()将数据从文件拷贝到这个缓冲区，write()将缓冲区数据写入网络。sendfile()是立即将数据从磁盘读到OS缓存。因为这种拷贝是在内核完成的，sendfile()要比组合read()和write()以及打开关闭丢弃缓冲更加有效(更多有关于sendfile)&lt;/p&gt; &lt;p&gt;&lt;strong&gt;tcp_nopush&lt;/strong&gt; 告诉nginx在一个数据包里发送所有头文件，而不一个接一个的发送&lt;/p&gt; &lt;p&gt;&lt;strong&gt;tcp_nodelay&lt;/strong&gt; 告诉nginx不要缓存数据，而是一段一段的发送C当需要及时发送数据时，就应该给应用设置这个属性，这样发送一小块数据信息时就不能立即得到返回值。&lt;/p&gt; &lt;blockquote&gt; &lt;ul&gt; &lt;li&gt;access_log off;&lt;/li&gt; &lt;li&gt;error_log /var/log/nginx/error.log crit;&lt;/li&gt; &lt;/ul&gt; &lt;/blockquote&gt; &lt;p&gt;&lt;strong&gt;access_log&lt;/strong&gt;设置nginx是否将存储访问日志。关闭这个选项可以让读取磁盘IO操作更快(aka,YOLO)。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;error_log &lt;/strong&gt;告诉nginx只能记录严重的错误。&lt;/p&gt; &lt;blockquote&gt; &lt;ul&gt; &lt;li&gt;keepalive_timeout 10;&lt;/li&gt; &lt;li&gt;client_header_timeout 10;&lt;/li&gt; &lt;li&gt;client_body_timeout 10;&lt;/li&gt; &lt;li&gt;reset_timedout_connection on;&lt;/li&gt; &lt;li&gt;send_timeout 10;&lt;/li&gt; &lt;/ul&gt; &lt;/blockquote&gt; &lt;p&gt;&lt;strong&gt;keepalive_timeout&lt;/strong&gt; 给客户端分配keep-alive链接超时时间。服务器将在这个超时时间过后关闭链接。我们将它设置低些可以让ngnix持续工作的时间更长。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;client_header_timeout&lt;/strong&gt; 和&lt;strong&gt;client_body_timeout&lt;/strong&gt; 设置请求头和请求体(各自)的超时时间。我们也可以把这个设置低些。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;reset_timeout_connection&lt;/strong&gt;告诉nginx关闭不响应的客户端连接。这将会释放那个客户端所占有的内存空间。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;send_timeout&lt;/strong&gt; 指定客户端的响应超时时间。这个设置不会用于整个转发器，而是在两次客户端读取操作之间。如果在这段时间内，客户端没有读取任何数据，nginx就会关闭连接。&lt;/p&gt; &lt;blockquote&gt; &lt;ul&gt; &lt;li&gt;limit_conn_zone $binary_remote_addr zone=addr:5m;&lt;/li&gt; &lt;li&gt;limit_conn addr 100;&lt;/li&gt; &lt;/ul&gt; &lt;/blockquote&gt; &lt;p&gt;&lt;strong&gt;limit_conn&lt;/strong&gt;为给定的key设置最大连接数。这里key是addr，我们设置的值是100，也就是说我们允许每一个IP地址最多同时打开有100个连接。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;limit_conn_zone&lt;/strong&gt;设置用于保存各种key（比如当前连接数）的共享内存的参数。5m就是5兆字节，这个值应该被设置的足够大以存储（32K*5）32byte状态或者（16K*5）64byte状态。&lt;/p&gt; &lt;blockquote&gt; &lt;ul&gt; &lt;li&gt;include /etc/nginx/mime.types;&lt;/li&gt; &lt;li&gt;default_type text/html;&lt;/li&gt; &lt;li&gt;charset UTF-8;&lt;/li&gt; &lt;/ul&gt; &lt;/blockquote&gt; &lt;p&gt;&lt;strong&gt;include&lt;/strong&gt;只是一个在当前文件中包含另一个文件内容的指令。这里我们使用它来加载稍后会用到的一系列的MIME类型。&lt;/p&gt;      讯幻网络; }; POST={public_flag=1; old_uid=418; url_args=&amp;s=&amp;status=1&amp;orderby=default&amp;ordersc=desc&amp;page=1; select=2; forums=51; set={title=绝对详细！Nginx基本配置、性能优化指南; summary=大多数的Nginx安装指南告诉你如下基础知识――通过apt-get安装，修改这里或那里的几行配置，好了，你已经有了一个Web服务器了！而且，在大多数情况下，一个常规安装的nginx对你的网站来说已经能很好地工作了。然而， ...; uid=418; view_num=61; is_download_img=1; is_water_img=1; public_time=2017-02-01 16:18; }; newalbum=请输入相册名称; view_albumid=none; message=&lt;p&gt;大多数的Nginx安装指南告诉你如下基础知识――通过apt-get安装，修改这里或那里的几行配置，好了，你已经有了一个Web服务器了！而且，在大多数情况下，一个常规安装的nginx对你的网站来说已经能很好地工作了。然而，如果你真的想挤压出nginx的性能，你必须更深入一些。在本指南中，我将解释Nginx的那些设置可以微调，以优化处理大量客户端时的性能。需要注意一点，这不是一个全面的微调指南。这是一个简单的预览――那些可以通过微调来提高性能设置的概述。你的情况可能不同。&lt;/p&gt; &lt;p style=&quot;text-align: center; text-indent: 0;&quot;&gt;&lt;img class=&quot;aligncenter&quot; src=&quot;http://upload.chinaz.com/2015/0424/1429857466710.jpg&quot; alt=&quot;Nginx配置 Nginx优化 Nginx安装&quot; border=&quot;0&quot; width=&quot;325&quot;&gt;&lt;/p&gt; &lt;p&gt;&lt;strong&gt;基本的 (优化过的)配置&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;我们将修改的唯一文件是&lt;strong&gt;nginx.conf&lt;/strong&gt;，其中包含Nginx不同模块的所有设置。你应该能够在服务器的&lt;strong&gt;/etc/nginx&lt;/strong&gt;目录中找到nginx.conf。首先，我们将谈论一些全局设置，然后按文件中的模块挨个来，谈一下哪些设置能够让你在大量客户端访问时拥有良好的性能，为什么它们会提高性能。本文的结尾有一个完整的配置文件。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;高层的配置&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;nginx.conf文件中，Nginx中有少数的几个高级配置在模块部分之上。&lt;/p&gt; &lt;blockquote&gt; &lt;ul&gt; &lt;li&gt;user www-data;&lt;/li&gt; &lt;li&gt;pid /var/run/nginx.pid;&lt;/li&gt; &lt;li&gt;worker_processes auto;&lt;/li&gt; &lt;li&gt;worker_rlimit_nofile 100000;&lt;/li&gt; &lt;/ul&gt; &lt;/blockquote&gt; &lt;p&gt;&lt;strong&gt;user&lt;/strong&gt;和&lt;strong&gt;pid&lt;/strong&gt;应该按默认设置 C 我们不会更改这些内容，因为更改与否没有什么不同。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;worker_processes &lt;/strong&gt;定义了nginx对外提供web服务时的worder进程数。最优值取决于许多因素，包括（但不限于）CPU核的数量、存储数据的硬盘数量及负载模式。不能确定的时候，将其设置为可用的CPU内核数将是一个好的开始（设置为“auto”将尝试自