/p&gt; &lt;p&gt;&lt;strong&gt;tcp_nodelay&lt;/strong&gt; 告诉nginx不要缓存数据，而是一段一段的发送C当需要及时发送数据时，就应该给应用设置这个属性，这样发送一小块数据信息时就不能立即得到返回值。&lt;/p&gt; &lt;blockquote&gt; &lt;ul&gt; &lt;li&gt;access_log off;&lt;/li&gt; &lt;li&gt;error_log /var/log/nginx/error.log crit;&lt;/li&gt; &lt;/ul&gt; &lt;/blockquote&gt; &lt;p&gt;&lt;strong&gt;access_log&lt;/strong&gt;设置nginx是否将存储访问日志。关闭这个选项可以让读取磁盘IO操作更快(aka,YOLO)。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;error_log &lt;/strong&gt;告诉nginx只能记录严重的错误。&lt;/p&gt; &lt;blockquote&gt; &lt;ul&gt; &lt;li&gt;keepalive_timeout 10;&lt;/li&gt; &lt;li&gt;client_header_timeout 10;&lt;/li&gt; &lt;li&gt;client_body_timeout 10;&lt;/li&gt; &lt;li&gt;reset_timedout_connection on;&lt;/li&gt; &lt;li&gt;send_timeout 10;&lt;/li&gt; &lt;/ul&gt; &lt;/blockquote&gt; &lt;p&gt;&lt;strong&gt;keepalive_timeout&lt;/strong&gt; 给客户端分配keep-alive链接超时时间。服务器将在这个超时时间过后关闭链接。我们将它设置低些可以让ngnix持续工作的时间更长。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;client_header_timeout&lt;/strong&gt; 和&lt;strong&gt;client_body_timeout&lt;/strong&gt; 设置请求头和请求体(各自)的超时时间。我们也可以把这个设置低些。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;reset_timeout_connection&lt;/strong&gt;告诉nginx关闭不响应的客户端连接。这将会释放那个客户端所占有的内存空间。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;send_timeout&lt;/strong&gt; 指定客户端的响应超时时间。这个设置不会用于整个转发器，而是在两次客户端读取操作之间。如果在这段时间内，客户端没有读取任何数据，nginx就会关闭连接。&lt;/p&gt; &lt;blockquote&gt; &lt;ul&gt; &lt;li&gt;limit_conn_zone $binary_remote_addr zone=addr:5m;&lt;/li&gt; &lt;li&gt;limit_conn addr 100;&lt;/li&gt; &lt;/ul&gt; &lt;/blockquote&gt; &lt;p&gt;&lt;strong&gt;limit_conn&lt;/strong&gt;为给定的key设置最大连接数。这里key是addr，我们设置的值是100，也就是说我们允许每一个IP地址最多同时打开有100个连接。&lt;/p&gt; &lt;p&gt;&lt;strong&gt;limit_conn_zone&lt;/strong&gt;设置用于保存各种key（比如当前连接数）的共享内存的参数。5m就是5兆字节，这个值应该被设置的足够大以存储（32K*5）32byte状态或者（16K*5）64byte状态。&lt;/p&gt; &lt;blockquote&gt; &lt;ul&gt; &lt;li&gt;include /etc/nginx/mime.types;&lt;/li&gt; &lt;li&gt;default_type text/html;&lt;/li&gt; &lt;li&gt;charset UTF-8;&lt;/li&gt; &lt;/ul&gt; &lt;/blockquote&gt; &lt;p&gt;&lt;strong&gt;include&lt;/strong&gt;只是一个在当前文件中包含另一个文件内容的指令。这里我们使用它来加载稍后会用到的一系列的MIME类型。&lt;/p&gt;      讯幻网络; };
